import requests
import time

def getUserInfo(cookies, uniqueId, userId):
    url = f"http://10.0.100.136/Admin/UserManagement/User/Edit?uniqueId={uniqueId}&userId={userId}&_={int(time.time()*1000)}"
    headers = {
        "Cookie": cookies
    }
    resp = requests.get(url, headers=headers)
    return resp.text


def daskboard(cookies):
    url = "http://10.0.100.136/Admin/Dashboard"
    headers = {
        "Cookie": cookies
    }
    resp = requests.get(url, headers=headers)
    return resp.text


def searchUser(cookies, username):
    url = f"http://10.0.100.136/Admin/UserManagement/User/Search?Keyword={username}&Offset=0&Limit=50&SortField=UserId&SortType=asc&_={int(time.time()*1000)}"
    headers = {
        "Cookie": cookies
    }
    resp = requests.get(url, headers=headers)
    return resp.text

